import { TableComplex, TableComplexOptions } from './TableComplex';

export default {
  title: 'Components/TableComplex',
  component: TableComplex,
  argTypes: {
    caption: { control: 'text' }
  }
} as ComponentMeta<typeof TableComplex>;

